	//////////////////////////////////////////////////////////////////////
	// Shader struct

	struct Instanced : ShaderState
	{
		//////////////////////////////////////////////////////////////////////
		// InputVertex

		struct InputVertex
		{
			Float3 Position;
			Float4x4 Matrix;
			Byte4 Color;
		};

		using VertBuffer = VertexBuffer<InputVertex>;

		//////////////////////////////////////////////////////////////////////
		// Vertex Shader

		struct VS : VertexShader, Aligned16
		{
			// Const Buffers

			struct VertConstants_t: Aligned16
			{
				Float4x4 Transform;
			};

			ConstBuffer<VertConstants_t> VertConstants;
			enum { VertConstants_index = 0 };

			// Constructor

			VS()
				: VertexShader(1, Instanced_VS_ConstBufferNames, 0, null, 0, null, null, null)
				, VertConstants(1, Instanced_VS_VertConstants_Offsets, null, this, 0, 6)
			{
				SetupConstBufferRuns();
			}
		};

		//////////////////////////////////////////////////////////////////////
		// Pixel Shader

		struct PS : PixelShader, Aligned16
		{
			// Constructor

			PS()
				: PixelShader(0, null, 0, null, 0, null, null, null)
			{
				SetupConstBufferRuns();
			}
		};

		//////////////////////////////////////////////////////////////////////
		// Members

		VS vs;
		PS ps;

		//////////////////////////////////////////////////////////////////////
		// Constructor

		Instanced(): ShaderState(Instanced_BlendDesc, Instanced_DepthStencilDesc, Instanced_RasterizerDesc)
		{
			FileResource f(TEXT("Data\\Instanced.sob"));
			vs.Load(f, Instanced_VS_InputElements, _countof(Instanced_VS_InputElements));
			ps.Load(f);
			Shaders[Vertex] = &vs;
			Shaders[Hull] = null;
			Shaders[Domain] = null;
			Shaders[Geometry] = null;
			Shaders[Pixel] = &ps;
			Shaders[Compute] = null;
		}

		//////////////////////////////////////////////////////////////////////
		// Activate

		void Activate(ID3D11DeviceContext *context)
		{
			ShaderState::SetState(context);
			vs.Activate(context);
			context->HSSetShader(null, null, 0);
			context->DSSetShader(null, null, 0);
			context->GSSetShader(null, null, 0);
			ps.Activate(context);
			context->CSSetShader(null, null, 0);
		}

		void Activate_V(ID3D11DeviceContext *context) override
		{
			Activate(context);
		}
	};
